import React from 'react';
import aboutData from '../DataFiles/AboutData.js';

function About() {
  return (
    <div>
      <h1>{aboutData.club.title}</h1>
      <p>{aboutData.club.description}</p>

      <h2>{aboutData.growth.title}</h2>
      <p>{aboutData.growth.description}</p>

      <h2>{aboutData.mission.title}</h2>
      <p>{aboutData.mission.description}</p>

      <h2>{aboutData.vision.title}</h2>
      <p>{aboutData.vision.description}</p>

      <h2>{aboutData.values.title}</h2>
      <ul>
        <li>{aboutData.values.collaboration}</li>
        <li>{aboutData.values.innovation}</li>
        <li>{aboutData.values.inclusivity}</li>
      </ul>
    </div>
  );
}

export default About;
